import React from 'react';
import './nav.css'

class NavBar extends React.Component{
    render(){
        return (
            <div className='navbar'>
                <h1 >Sol</h1>
                <ul >
                    <li >Cool graph I can do with API data</li>
                    <li >Test to email app</li>
                    <li >Park app</li>
                    <li>Awesome game about true love</li>
                </ul>
            </div>
        )
    }
}

export default NavBar;
